import React from 'react';
import { Button, DatePicket, version } from 'antd';
import './App.css';
import 'antd/dist/antd.css';

const App = () => (
  <div className = 'App'>
    <h1>antd version: {version}</h1>
    <DatePicket />
    <Button type = 'primary' style = {{marginLeft: 8}}>Primary Button</Button>
  </div>
)

export default App;
